import React from "react";
import ReactDOM from "react-dom";
import Card from "./Cards";
import Sdata from "./Sdata";
// console.log(Sdata[0]);

ReactDOM.render(
  <>


    {Sdata.map((val) => {
      return (
        <Card
          key={val.id}
          imgSrc={val.imgSrc}
          sname={val.sname}
          title={val.title}
          links={val.links}
        />
      );
    })}
  </>,
  document.getElementById("root")
);
